INSERT INTO `question_description` (`Question_Description_ID`, `Teacher_ID`, `Course_Code`, `Batch`, `Section`, `Course_Name`, `Title`, `Meeting_Link`, `Action`, `Content`) VALUES
(1, 10893, 'CSE-3117', 44, 'C', 'Computer Architecture & Design', 'Midterm Exam, Fall-2019', '', 'Posted', '<p style=\"text-align: left; \"><b>1.</b> Each line of that file has three data items, separated by tabs. The first datum <span style=\"font-size: 1rem;\">on each line is the address of the branch instruction in hex. The second datum is </span><span style=\"font-size: 1rem;\">the branch target address in hex. The third datum is a 1 or a 0; 1 indicates a taken  </span><span style=\"font-size: 1rem;\">branch, and 0 indicates not taken.</span></p><p style=\"text-align: left; \">      <b>(a)</b> Write a model of a simple four-state branch target <span style=\"font-size: 1rem;\">buffer with 64 entries.</span></p><p style=\"text-align: left; \"><span style=\"font-size: 1rem;\">      <b>(b)</b> </span><span style=\"text-align: center;\">What is the overall hit rate in the BTB (the fraction of times a branch was looked up in the BTB and found present)?</span></p><p style=\"text-align: left; \"><span style=\"text-align: center;\">      <b>(c)</b> </span>What is the overall branch misprediction rate on a cold start (the <span style=\"text-align: center; font-size: 1rem;\">fraction of times a branch was correctly predicted taken or not taken,                           regardless </span><span style=\"text-align: center; font-size: 1rem;\">of whether that prediction “belonged to” the branch being predicted)?</span></p><p style=\"text-align: left; \"><span style=\"text-align: center; font-size: 1rem;\">      <b>(d)</b> </span>Find the most common branch. What was its contribution to the <span style=\"text-align: center; font-size: 1rem;\">overall number of correct predictions? (Hint: Count the number of times                     that </span><span style=\"text-align: center; font-size: 1rem;\">branch occurs in the history.txt file, then track how each instance of that </span><span style=\"text-align: center; font-size: 1rem;\">branch fares within the BTB model.)</span></p><p style=\"text-align: left; \"><span style=\"text-align: center; font-size: 1rem;\"><br></span></p><p style=\"text-align: left; \"><span style=\"text-align: center; font-size: 1rem;\"><b>2.</b> </span>Besides studying microarchitecture techniques, to really understand computer <span style=\"text-align: center; font-size: 1rem;\">architecture you must also program computers. Getting your hands dirty by </span><span style=\"text-align: center; font-size: 1rem;\">directly modeling various microarchitectural ideas is better yet. Write a C or Java </span><span style=\"text-align: center; font-size: 1rem;\">program to model a 2,1 branch predictor. Your program will read a series of lines </span><span style=\"text-align: center; font-size: 1rem;\">from a file named history.txt (available on the companion CD—see Figure Figure </span><span style=\"text-align: center; font-size: 1rem;\">2.43).</span></p><p style=\"text-align: left; \"><span style=\"text-align: center; font-size: 1rem;\">      </span><span style=\"font-size: 1rem; font-weight: bolder;\">(a)</span><span style=\"font-size: 1rem;\"> </span><span style=\"font-size: 1rem;\">Write a model of a simple four-state branch target </span><span style=\"font-size: 1rem;\">buffer with 64 entries.</span></p><p style=\"text-align: left;\"><span style=\"font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(b)</span> </span><span style=\"text-align: center;\">What is the overall hit rate in the BTB (the fraction of times a branch was looked up in the BTB and found present)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center;\">      <span style=\"font-weight: bolder;\">(c)</span> </span>What is the overall branch misprediction rate on a cold start (the <span style=\"text-align: center; font-size: 1rem;\">fraction of times a branch was correctly predicted taken or not taken,                           regardless </span><span style=\"text-align: center; font-size: 1rem;\">of whether that prediction “belonged to” the branch being predicted)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(d)</span> </span>Find the most common branch. What was its contribution to the <span style=\"text-align: center; font-size: 1rem;\">overall number of correct predictions? (Hint: Count the number of times                     that </span><span style=\"text-align: center; font-size: 1rem;\">branch occurs in the history.txt file, then track how each instance of that </span><span style=\"text-align: center; font-size: 1rem;\">branch fares within the BTB model.)</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\"><br></span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\"><span style=\"font-weight: bolder;\">3.</span> </span>Besides studying microarchitecture techniques, to really understand computer <span style=\"text-align: center; font-size: 1rem;\">architecture you must also program computers. Getting your hands dirty by </span><span style=\"text-align: center; font-size: 1rem;\">directly modeling various microarchitectural ideas is better yet. Write a C or Java </span><span style=\"text-align: center; font-size: 1rem;\">program to model a 2,1 branch predictor. Your program will read a series of lines </span><span style=\"text-align: center; font-size: 1rem;\">from a file named history.txt (available on the companion CD—see Figure Figure </span><span style=\"text-align: center; font-size: 1rem;\">2.43).</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\">      </span><span style=\"font-size: 1rem; font-weight: bolder;\">(a)</span><span style=\"font-size: 1rem;\"> </span><span style=\"font-size: 1rem;\">Write a model of a simple four-state branch target </span><span style=\"font-size: 1rem;\">buffer with 64 entries.</span></p><p style=\"text-align: left;\"><span style=\"font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(b)</span> </span><span style=\"text-align: center;\">What is the overall hit rate in the BTB (the fraction of times a branch was looked up in the BTB and found present)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center;\">      <span style=\"font-weight: bolder;\">(c)</span> </span>What is the overall branch misprediction rate on a cold start (the <span style=\"text-align: center; font-size: 1rem;\">fraction of times a branch was correctly predicted taken or not taken,                           regardless </span><span style=\"text-align: center; font-size: 1rem;\">of whether that prediction “belonged to” the branch being predicted)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(d)</span> </span>Find the most common branch. What was its contribution to the <span style=\"text-align: center; font-size: 1rem;\">overall number of correct predictions? (Hint: Count the number of times                     that </span><span style=\"text-align: center; font-size: 1rem;\">branch occurs in the history.txt file, then track how each instance of that </span><span style=\"text-align: center; font-size: 1rem;\">branch fares within the BTB model.)</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\"><br></span></p><p style=\"text-align: left;\"><span style=\"font-weight: bolder;\">4.</span> Each line of that file has three data items, separated by tabs. The first datum <span style=\"font-size: 1rem;\">on each line is the address of the branch instruction in hex. The second datum is </span><span style=\"font-size: 1rem;\">the branch target address in hex. The third datum is a 1 or a 0; 1 indicates a taken  </span><span style=\"font-size: 1rem;\">branch, and 0 indicates not taken.</span></p><p style=\"text-align: left;\">      <span style=\"font-weight: bolder;\">(a)</span> Write a model of a simple four-state branch target <span style=\"font-size: 1rem;\">buffer with 64 entries.</span></p><p style=\"text-align: left;\"><span style=\"font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(b)</span> </span><span style=\"text-align: center;\">What is the overall hit rate in the BTB (the fraction of times a branch was looked up in the BTB and found present)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center;\">      <span style=\"font-weight: bolder;\">(c)</span> </span>What is the overall branch misprediction rate on a cold start (the <span style=\"text-align: center; font-size: 1rem;\">fraction of times a branch was correctly predicted taken or not taken,                           regardless </span><span style=\"text-align: center; font-size: 1rem;\">of whether that prediction “belonged to” the branch being predicted)?</span></p><p style=\"text-align: left;\"><span style=\"text-align: center; font-size: 1rem;\">      <span style=\"font-weight: bolder;\">(d)</span> </span>Find the most common branch. What was its contribution to the <span style=\"text-align: center; font-size: 1rem;\">overall number of correct predictions? (Hint: Count the number of times                     that </span><span style=\"text-align: center; font-size: 1rem;\">branch occurs in the history.txt file, then track how each instance of that </span><span style=\"text-align: center; font-size: 1rem;\">branch fares within the BTB model.)</span></p><p style=\"text-align: left; \"><br></p>'),
